import logo from "../assests/images/logo.svg"

const Navbar = () => {
  return(
    <div>
      <h1 className="p-5 font-bold text-left text-white text-lg">sunnyside</h1>
      <img scr={logo} alt=""/>
    </div>
  )
}
export default Navbar
